  return (
    <div>
      <HeaderComponent tag="h1" text="What's the Plan for Today?" />
      <center>
        <InputComponent placeholder="Enter some plan" />
        <ButtonComponent text="Add" color="green" />
        <Modal>
          <div>I am a modal</div>
